var patm = 1.001805;                    // Presion atmosferica aprox en Piura
var temp = msg.payload["TEMP(C)"];     // Temperatura registrada por el sensor de temperatura
var DOin = msg.payload["DO(%)"];        // Valor de % de OD a convertir a ppm (1 mg/L = 1 ppm)
// Ver página: https://www.waterontheweb.org/under/waterquality/oxygen.html
// Ecuación para el cálculo de Cp
var cp = ((Math.exp(7.7117-1.31403*Math.log(temp+45.93))) * patm * (1-Math.exp(11.8571-(3840.7/(temp+273.15))-(216961/((temp+273.15)^2)))/patm)* (1-(0.000975-(0.00001426*temp)+(0.00000006436*(temp^2)))*patm))/ (1-Math.exp(11.8571-(3840.7/(temp+273.15))-(216961/((temp+273.15)^2))))/ (1-(0.000975-(0.00001426*temp)+(0.00000006436*(temp^2))));
// Formula de conversión de % a ppm
var DOout = DOin*cp/100.0;
msg.payload["DO(%)"] = Number(DOout.toPrecision(3));    // Se almacena el valor de OD en ppm en la misma propiedad del payload ("msg.payload["DO(%)"]")

msg.payload["PH"] = Number(msg.payload["PH"].toPrecision(3));
msg.payload["BAT(mV)"] = Number(msg.payload["BAT(mV)"].toPrecision(3));

return msg;                                             // en el siguiente nodo se cambia el nombre de la propiedad de DO(%) a DO(ppm)

